import React from "react";
import { Route, Redirect } from "react-router-dom";

const PrivateRouteTwo = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) => {
        if (localStorage.getItem("token")) {
          return <Component {...props} />;
        } else {
          return <Redirect to="/" />;
        }
      }}
    />
  );
};
export default PrivateRouteTwo;
